import React from "react";
import Header from "./components/Header/Header";
import Menu from "./components/Menu/Menu";
import Content from "./components/Content/Content";

class Main extends React.Component{
    render() {
        return (
            <div>
                <Header title={'Katya'}/>
                <Menu />
                <Content />
            </div>
        )
    }
}

export default Main;
